import PropTypes from 'prop-types';

const ConnectNotification = props => {
    return (
        <div>
            <p className='text-gray-700 text-xl mb-8'>You have already enabled Telegram notifications</p>
            <div className='flex items-center mb-10'>
                <span className='font-medium mr-5'>Telegram ID:</span>
                <span>123456789</span>
            </div>
        </div>
    );
};

ConnectNotification.propTypes = {};

export default ConnectNotification;
